import React from "react";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Cloud(props) {
    let cloudClass = "cloud " + props.type;
    let gridLocation = "span: 4, offset:" + props.offset
    return <Row><Col xs={gridLocation}><img className ={cloudClass} src="media/cloud2.svg" alt="cloud" /></Col></Row>;
}

export default Cloud;
